function tweenUpdateCb() {
    TWEEN.update();
}
appInstance.renderCallbacks.push(tweenUpdateCb);
if (v3d.PL.editorRenderCallbacks)
    v3d.PL.editorRenderCallbacks.push([appInstance, tweenUpdateCb]);



// animateParam puzzle
_pGlob.animateParamUpdate = 0;

function animateParam(from, to, duration, easing, easing2, repeat, yoyo, on_update, when_finished) {

    var mode = easing == "Linear" ?
        TWEEN.Easing.Linear.None : TWEEN.Easing[easing][easing2];

    var tweenObject = (typeof from != "number");

    if (!tweenObject) { // number
        from = [from];
        to = [to];
    }

    var tween = new TWEEN.Tween(from)
                    .to(to, duration * 1000)
                    .easing(mode)
                    .repeat(repeat)
                    .yoyo(yoyo)
                    .onUpdate(function (object) {
                        if (tweenObject)
                            _pGlob.animateParamUpdate = object;
                        else // number
                            _pGlob.animateParamUpdate = object[0];
                        on_update();
                    })
                    .onComplete(function (object) {
                        when_finished();
                    })
                    .start();
}


// Describe this function...
function CAROUSEL_ROTATE(carousel_forward) {
  if (carousel_is_rotating == false) {
    carousel_is_rotating = true;
    carousel_begin_angle = carousel_current_angle;
    carousel_target_angle = carousel_begin_angle + (carousel_forward ? 60 : -60);
    lottie_dict_index = (typeof lottie_dict_index == 'number' ? lottie_dict_index : 0) + (carousel_forward ? 1 : -1);
    if (lottie_dict_index >= 6) {
      lottie_dict_index = 0;
    } else if (lottie_dict_index <= -1) {
      lottie_dict_index = 5;
    }
    console.log('lottie_dict_index: ' + String(lottie_dict_index));
    current_carousel_lottie = dictGet(DICT_Lottie_Names, lottie_dict_index);
    console.log('current carousel lottie: ' + String(current_carousel_lottie));

    animateParam(carousel_begin_angle, carousel_target_angle, 1, 'Quartic', 'InOut', 0, false,
        function() {
      setObjTransform('Carousel_Grid', false, 'rotation', ['', '', _pGlob.animateParamUpdate || 0], false);
    },
        function() {
      carousel_current_angle = Math.round(carousel_target_angle);
      console.log('carousel_angle: ' + String(carousel_current_angle));
      carousel_is_rotating = false;
    });

        }
}

